using ObjectiveC;using System;using SwiftSharp.Attributes;namespace Foundation{	//https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/NSCacheDelegate_Protocol/index.html#//apple_ref/occ/intf/NSCacheDelegate	/// <summary>	/// The delegate of an NSCache object implements this protocol to perform specialized actions when an object is about to be evicted or removed from the cache.	/// </summary>	[iOSVersion(4)]	public interface NSCacheDelegate	{		/// <summary>		/// Called when an object is about to be evicted or removed from the cache.		/// </summary>		/// <param name="cache">The cache with which the object of interest is associated.</param>		/// <param name="willEvictObject">The object of interest in the cache.</param>		[iOSVersion(4)]		[Export("cache")]		[Optional]		void Cache(NSCache cache, AnyObject willEvictObject);	}}